    private IEnumerable<Maintenance> Maintenances { get; set; }

    [Parameter]
    public int CarId { get; set; }

    [Parameter]
    public EventCallback<int> DetailsCallback { get; set; }

    public void Redirect(int id)
    {
        NavManager.NavigateTo("/Maintenance/" + id);
    }

    protected async override Task OnInitializedAsync()
    {
        if (CarId != 0)
        {
            Maintenances = await MaintenanceRepository.WhereAsync(m => m.CarId == CarId);

        }
        else
        {
            Maintenances = await MaintenanceRepository.GetAllAsync();
        }

    }

